import Expenses from "./components/Expenses/Expenses";
import NewExpense from "./components/NewExpense/NewExpense";
import { useState } from "react";

const expenses = [
  {
    id: "e1",
    title: "Toilet Paper",
    amount: 94.12,
    date: new Date(2020, 7, 14),
  },
  { id: "e2", title: "New TV", amount: 799.49, date: new Date(2021, 2, 12) },
  {
    id: "e3",
    title: "Car Insurance",
    amount: 294.67,
    date: new Date(2021, 2, 28),
  },
  {
    id: "e4",
    title: "New Desk (Wooden)",
    amount: 450,
    date: new Date(2021, 5, 12),
  },
];

const expnseHandler = (expenseData) => {
  const expense = {
    ...expenseData,
  };
  console.log(`Comming fofrm App.js`);
  console.log(expense);
};

function App() {
  const [initExpenses, setExpense] = useState(expenses);
  setExpense((prevState) => {
    return [expense];
  });
  return (
    <div>
      <NewExpense onExpensDataForm={expnseHandler} />
      <Expenses itmes={initExpenses} />
    </div>
  );
}

export default App;
